import React, { Component}  from 'react'
import './Game.css'
import Board from './Board';

export default class Game extends Component {
    constructor(props) {
        super(props);
        this.state = {
            history: [{
                squares: Array(9).fill(null),
            }],
            xIsNext: true,
        };
    }

    render() {
        return (
            <div className='game'>
                <div className='game-board'>
                     <Board />
                </div>
                <div className='game-info'>
                    <div></div>
                    <ol></ol>
                </div>
            </div>
        );
    }
}
